import React from 'react';
import NavBar from './NavBar';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Counter from './Counter';
import Dart from './Dark';
import Profile from './Profile';



function App() {
  return (
    <Router>
      <Switch>
          <Route path="/counter">
            <Counter />
          </Route>
          <Route path="/dart">
            <Dart />
          </Route>
          <Route path="profile">
            <Profile />
          </Route>
      </Switch>
   </Router>
  )
}

export default App
